import { Link } from "react-router-dom";
import Container from "react-bootstrap/Container";
import Nav from "react-bootstrap/Nav";
import Navbarboot from "react-bootstrap/Navbar";
import NavDropdown from "react-bootstrap/NavDropdown";

const Navbar = () => {
  return (
    <header>
      <div className="navbar animate__animated animate__fadeInLeft animate__slower">
        <Navbarboot bg="dark" variant="dark">
          <Container>
            <Navbarboot.Brand>
              <Link to="/">
                <h1>Workout Buddy</h1>
              </Link>
            </Navbarboot.Brand>
            <Nav className="me-auto">
              <Nav.Link href="#home" className="sign">
                Sign in
              </Nav.Link>
              <Nav.Link href="#features" className="sign">
                Sign up
              </Nav.Link>
            </Nav>
          </Container>
        </Navbarboot>
      </div>
    </header>
  );
};

export default Navbar;
